func bbsI() wtype.TypeIIs {
	enzyme, _ := lookup.TypeIIs("bbsI")
	return enzyme
}

func aarI() wtype.TypeIIs {
	enzyme, _ := lookup.TypeIIs("aaRI")
	return enzyme
}

// commonly used restriction enzyme
func ecoRI() wtype.RestrictionEnzyme {
	enzyme, _ := lookup.RestrictionEnzyme("EcoRI")
	return enzyme
}

// commonly used blunt restriction enzyme
func ecoRV() wtype.RestrictionEnzyme {
	enzyme, _ := lookup.RestrictionEnzyme("EcoRV")
	return enzyme
}

// cuts with wobble nucleotides
func accI() wtype.RestrictionEnzyme {
	enzyme, _ := lookup.RestrictionEnzyme("AccI")
	return enzyme
}

// cuts leaving 3' overhang
func bbeI() wtype.RestrictionEnzyme {
	enzyme, _ := lookup.RestrictionEnzyme("BbeI")
	return enzyme
}

// cuts with wobble nucleotides leaving 3' overhang
func banII() wtype.RestrictionEnzyme {
	enzyme, _ := lookup.RestrictionEnzyme("BanII")
	return enzyme
}

