func TestDigest(t *testing.T) {
	for _, test := range digesttests {
		fragments, err := DigestToFragments(test.sequence, test.enzymes...)
		if err != nil {
			if err.Error() != test.expectedErr {
				t.Error(err.Error())
			}
		}
		if len(fragments) != len(test.Finalfragments) {
			t.Error(
				"For", test.sequence.Name(), "\n",
				"and", fmt.Sprintf("%+v", test.enzymes), "\n",
				"expected fragments: \n", strings.Join(test.Finalfragments, "\n"), "\n",
				"got \n", text.PrettyPrint(fragments), "\n",
			)

		} else {
			var fragmentFail, fivePrimeOver, threePrimeUnder, fivePrimeUnder, threePrimeOver bool
			for i := 0; i < len(fragments); i++ {
				if fragments[i].TopStrand != test.Finalfragments[i] {
					fragmentFail = true
					break
				}
				if i < len(test.fivePrimeOverhangs) {
					if fragments[i].FivePrimeTopStrandStickyend != test.fivePrimeOverhangs[i] {
						fivePrimeOver = true
						break
					}
				}
				if i < len(test.threePrimeUnderhangs) {
					if fragments[i].FivePrimeBottomStrandStickyend != test.threePrimeUnderhangs[i] {
						threePrimeUnder = true
						break
					}
				}
				if i < len(test.fivePrimeUnderhangs) {
					if fragments[i].ThreePrimeBottomStrandStickyEnd != test.fivePrimeUnderhangs[i] {
						fivePrimeUnder = true
						break
					}
				}
				if i < len(test.threePrimeOverhangs) {
					if fragments[i].ThreePrimeTopStrandStickyend != test.threePrimeOverhangs[i] {
						threePrimeOver = true
						break
					}
				}

			}

			if fragmentFail {
				t.Error(
					"For", test.sequence.Name(), "\n",
					"and", fmt.Sprintf("%+v", test.enzymes), "\n",
					"expected fragments: \n", strings.Join(test.Finalfragments, "\n"), "\n",
					"got \n", text.PrettyPrint(fragments), "\n",
				)
			}
			if fivePrimeOver {
				t.Error(
					"For", test.sequence.Name(), "\n",
					"and", fmt.Sprintf("%+v", test.enzymes), "\n",
					"expected 5 prime overhangs: \n", strings.Join(test.fivePrimeOverhangs, "\n"), "\n",
					"got \n", text.PrettyPrint(fragments), "\n",
				)
			}
			if threePrimeUnder {
				t.Error(
					"For", test.sequence.Name(), "\n",
					"and", fmt.Sprintf("%+v", test.enzymes), "\n",
					"expected 3 prime underhangs: \n", strings.Join(test.threePrimeUnderhangs, "\n"), "\n",
					"got \n", text.PrettyPrint(fragments), "\n",
				)
			}
			if fivePrimeUnder {
				t.Error(
					"For", test.sequence.Name(), "\n",
					"and", fmt.Sprintf("%+v", test.enzymes), "\n",
					"expected 5 prime underhangs: \n", strings.Join(test.fivePrimeUnderhangs, "\n"), "\n",
					"got \n", text.PrettyPrint(fragments), "\n",
				)
			}
			if threePrimeOver {
				t.Error(
					"For", test.sequence.Name(), "\n",
					"and", fmt.Sprintf("%+v", test.enzymes), "\n",
					"expected 3 prime overhangs: \n", strings.Join(test.threePrimeOverhangs, "\n"), "\n",
					"got \n", text.PrettyPrint(fragments), "\n",
				)
			}
		}
	}
}

// simple reverse complement check to test testing methodology initially
type testsequence struct {
	sequence string
	revcomp  string
}

var seqs = []testsequence{
	{"ATG", "CAT"},
	{"YNB", "VNR"},
}

func TestRevComp(t *testing.T) {
	for _, sequence := range seqs {
		r := wtype.RevComp(sequence.sequence)
		if r != sequence.revcomp {
			t.Error(
				"For", sequence.sequence, "/n",
				"expected", sequence.revcomp, "\n",
				"got", r, "\n",
			)
		}
	}

}

