func TestJoinXnumberofparts(t *testing.T) {
	for _, assembly := range assemblytests {
		fragments, plasmidProducts, err := FindAllAssemblyProducts(assembly.vector, assembly.parts, assembly.enzymes...)
		var present bool
		for _, plasmidProduct := range plasmidProducts {
			seqInSeq := sequences.FindAll(&plasmidProduct, &assembly.desiredassemblyproduct)
			if len(seqInSeq.Positions) > 0 {
				present = true
				break
			}
		}

		if !present {
			t.Error(
				"For", assembly, "\n",
				"expected", assembly.desiredassemblyproduct, "\n",
				"got plasmids: ", plasmidProducts, "\n",
				"got fragments: ", fragments, "\n",
			)
		}
		if err != nil {
			t.Error(err.Error())
		}
	}
}

